import React from 'react';

const LoginComponent = (props) => {
    return (
        <div>
            <div>이메일</div>
            <input/>
            <div>비밀번호</div>
            <input/>
            <div onClick={()=>props.setLoginOrSignUp()}>로그인</div>
            <div>회원가입</div>
        </div>
    );
};

export default LoginComponent;
